nced swing and can hit a good fastball the other way. Does not like breaking balls at all and he gets inbetween pitches and doesn\'t know which to sit on.',''),(37,'OF',4,38,0.211,2,0,32,2,8,11,0.286,5,9,1,0.368,0,0,'So.','Trevor  Marrs','trevormarrs',0.654,0,'',''),(38,'C',4,30,0.233,3,0,27,1,7,4,0.324,7,5,0,0.367,1,0,'Jr.','Kevin  Gregersen','kevingregersen',0.691,0,'',''),(39,'C',4,18,0.222,1,0,18,2,4,0,0.318,4,4,0,0.556,0,0,'So.','Mack  Cheli','mackcheli',0.874,0,'',''),(40,'C',4,12,0.167,1,1,7,0,2,5,0.231,1,0,0,0.167,0,0,'Jr.','Mitchell  Briggs','mitchellbriggs',0.398,0,'Yank swing and wants to pull the ball. Will hit a mistake up in the zone, but will struggle with low and away',''),(41,'OF',4,6,0.000,4,0,12,0,0,5,0.364,1,2,0,0.000,0,0,'Jr.','Joel  Brown','joelbrown',0.364,0,'',''),(42,'INF',4,4,0.000,1,0,5,0,0,0,0.200,1,1,0,0.000,0,0,'So.','Kyle  Joye','kylejoye',0.200,0,'',''),(43,'INF',4,2,0.000,3,0,7,0,0,1,0.600,0,1,0,0.000,0,0,'So.','James  Knigh','jamesknigh',0.600,0,'',''),(44,'OF/P',2,161,0.329,11,1,43,1,53,18,0.379,40,32,1,0.447,8,4,'Sr.','Brandon  Vogel','brandonvogel',0.826,0,'Slow bat, FB in beats him. He hunts FB over the plate, and cannot pick up sliders and becomes unbalanced. Not very good. Tried to drag a few times, and can run a little.',''),(45,'INF',2,140,0.250,16,0,43,0,35,20,0.357,19,31,5,0.293,6,0,'Jr.','Jacob  Benson','jacobbenson',0.650,0,'Pretty patient, slow bat so just attack him he looking for FB over the plate, not very physical, can run a little bit. Trouble with velo inside. No pop. Can pitch away too.',''),(46,'OF',2,129,0.364,16,2,40,0,47,17,0.459,22,33,2,0.473,10,2,'Sr.','Christopher  Ligot','christopherligot',0.932,1,'Flat bat. Looks to bunt and has some bat control, they use him for hit and runs at times too. Has trouble picking up sliders. Breaking balls early, FB in late.','6BKSK_bGYIw'),(47,'INF',2,115,0.296,8,1,34,1,34,23,0.367,8,18,0,0.435,9,2,'Sr.','Lukas  Granado','lukasgranado',0.802,0,'Pull happy, lungy, trying to hunt FB over the plate, looked bad on breaking balls.',''),(48,'C',2,109,0.404,18,4,38,0,44,10,0.515,22,24,1,0.468,5,1,'Jr.','Adam  Santa Cruz','adamsantacruz',0.983,0,'A little patient at times, kid has some bat control. Showed FPS v CLU. Stays balanced and tries to just stay gap to gap. Watch out for hit and run. Sat pitches at times, as he had some big swing on breaking balls. Did a good job with two strikes staying oppo, FB in late will work.',''),(49,'INF',2,88,0.352,11,0,34,1,34,10,0.447,22,20,1,0.443,5,0,'Sr.','Christopher  Peres','christopherperes',0.890,1,'Inside out swing, hunts FB middle away, took all three breaking balls in an at bat. Breaking balls early and FB in late, good bat control and tough with 2k.Weakness is inside.','RzX8BxyD5CA'),(50,'INF',2,57,0.298,18,1,26,1,17,9,0.481,8,16,2,0.421,2,1,'Sr.','Rudy  Casarez III','rudycasareziii',0.902,0,'',''),(51,'C',2,36,0.333,7,0,16,1,12,3,0.455,8,11,1,0.500,3,0,'So.','Gabe  Lopez','gabelopez',0.955,0,'',''),(52,'1B',2,29,0.310,4,0,22,0,9,7,0.459,5,6,1,0.379,2,0,'Sr.','Ryan  Aguilar','ryanaguilar',0.838,0,'',''),(53,'INF',2,21,0.190,3,0,12,0,4,3,0.320,4,6,0,0.238,1,0,'Jr.','Aaron  Fong','aaronfong',0.558,0,'',''),(54,'INF',2,15,0.133,0,0,12,0,2,3,0.188,0,4,3,0.133,0,0,'Sr.','Ryan  Galan','ryangalan',0.321,0,'',''),(55,'INF',2,8,0.000,0,0,12,0,0,4,0.111,0,5,0,0.000,0,0,'Sr.','Eric  Munsey','ericmunsey',0.111,0,'',''),(56,'OF',2,1,0.000,1,0,2,0,0,1,0.500,0,0,0,0.000,0,0,'Sr.','Garrett  Barnes','garrettbarnes',0.500,0,'',''),(57,'INF',9,152,0.316,13,2,38,0,48,15,0.376,28,32,8,0.408,8,3,'So.','Tanner  Wright','tannerwright',0.784,0,'Looking pull side early and wanted to swing early. Three bunts on the day, looks to do it often. Tried a drag to both sides of the field and sac bunt late in a close game. Has some speed and will look to run right away. He\'s just hunting FB early to the pull side. Not much pop.',''),(58,'INF',9,142,0.387,19,3,38,0,55,15,0.486,32,28,7,0.486,12,1,'Jr.','Ryne  Yamashiro','ryneyamashiro',0.972,1,'Pretty good balanced hitter was taking breaking balls early and swinging at them later in game, early in counts. Seems to sit pitches as he swung at a 0-0 breaking ball second at bat and rolled it over. Did not do to well with the breaking balls even though he was sitting them. Struckout on four straight breakers. Trying to go pull side with FB he sits on. Will FPS. Good hitter.','f9yeygssICA'),(59,'INF',9,110,0.291,4,2,32,0,32,24,0.316,21,21,6,0.400,12,0,'Sr.','Cheynne  Giles','cheynnegiles',0.716,1,'Off dish. Can beat away. Battles with 2 strikes.','3onhUtJAN6w'),(60,'1B',9,100,0.270,17,0,35,3,27,10,0.387,23,17,2,0.420,6,0,'Sr.','Weston  Clark','westonclark',0.807,1,'LHH looking to pull and get the head out. Has some power , did not look good against changeups, and seems to sit pitches. Swung at some breaking balls early in counts with runners in scoing position. Will FPS. Will rollover on slider away from LHP. On dish.','6BuTtjOb-Sg'),(61,'INF',9,88,0.273,6,1,31,0,24,10,0.333,8,14,4,0.295,2,0,'Sr.','Trevor  Egan','trevoregan',0.628,0,'Really aggressive at the plate and on the bases. Aggressive on FB andtries to go pull side early. He\'s long and slow bat even though he tries to pull. He also had a drag bunt hit, and tried another at bat. Stole first pitch twice with 2 outs, and looks to run. Hit a 3-2 SL up the middle, adjusts oppo w two strikes.',''),(62,'OF',9,84,0.345,12,2,28,0,29,12,0.429,13,23,3,0.429,7,0,'Jr.','Matt  Sciumbato','mattsciumbato',0.858,0,'Really patient, and wasn\'t swinging much all day. LV got him K, and roll over with 2k\'s on breaking balls down and in the dirt, wasn\'t picking up the breaking ball. Stays inside ball, can get inside early with some velo.',''),(63,'C',9,82,0.354,12,0,32,0,29,16,0.451,20,14,2,0.427,6,0,'Sr.','Kaden  White','kadenwhite',0.878,1,'None available.','PzPXxnS7GnE'),(64,'OF',9,63,0.492,3,2,26,0,31,12,0.529,16,14,7,0.635,9,0,'Jr.','Cortez  Espinoza','cortezespinoza',1.164,0,'',''),(65,'INF',9,59,0.424,6,2,22,0,25,4,0.507,11,18,6,0.441,1,0,'Sr.','Anthony  Sidley','anthonysidley',0.948,0,'',''),(66,'OF',9,58,0.259,9,1,21,0,15,12,0.343,10,9,3,0.276,1,0,'Sr.','Jeff  Wilson','jeffwilson',0.619,0,'Was agressive all day on FB and to the pull side. Located FB on outer half working against him and didn\'t look good on SL in any count. Couple strikeouts on SL with 2k\'s. Ambush. Tried to drag bunt a few times. Very aggressive.',''),(67,'C',9,50,0.280,8,0,24,1,14,16,0.390,9,9,0,0.420,4,0,'Jr.','Nick  Coast','nickcoast',0.810,0,'Short stocky righty, kid can swing it looks to pull FB early, doesn\'t land square some times and can see his hip firing to the pull-side. Does a good job of changing his approach with two strikes, both of his doubles on the day were with two strikes. Flash some breaking balls early and FB away and FB in late. LV was getting him early in counts to swing at righty righty changeups.',''),(68,'OF',9,45,0.222,9,1,21,1,10,12,0.375,7,15,1,0.333,2,0,'So.','Daniel  Parr','danielparr',0.708,1,'None available.','-MXXzlCKoC8'),(69,'C',9,35,0.286,0,0,18,0,10,6,0.316,6,6,0,0.343,0,1,'Jr.','Chris  Spohr','chrisspohr',0.659,0,'',''),(70,'INF',9,33,0.273,5,0,4,0,9,8,0.375,8,4,3,0.273,0,0,'Jr.','Daniel  Stauffer','danielstauffer',0.648,0,'',''),(71,'C',9,30,0.233,3,0,16,0,7,5,0.314,5,9,0,0.333,3,0,'So.','Ethan  Go','ethango',0.647,0,'Worst hitter in the lineup, small contact, bat control type of player. They tried to hit and run, and bunt with him a little bit. Slow bat speed, he was just hunting fastballs over the plate. FBin beat him all day and with two strikes. With no one on base he was aggressive on FB\'s. 2.2-2.3 from behind the plate we can run on him.',''),(72,'RHP',9,12,0.167,1,0,17,1,2,1,0.267,3,5,0,0.417,0,0,'Jr.','Troy  Frazier','troyfrazier',0.684,0,'',''),(73,'1B',9,9,0.333,1,0,6,1,3,2,0.400,4,5,0,0.778,1,0,'So.','Zach  Bullard','zachbullard',1.178,0,'',''),(74,'INF',9,8,0.375,1,0,17,0,3,1,0.444,1,3,0,0.500,1,0,'So.','Myles  Gonzalez','mylesgonzalez',0.944,0,'',''),(75,'1B',9,6,0.167,0,0,3,0,1,1,0.167,1,1,0,0.167,0,0,'So.','Junior  Sandoval','juniorsandoval',0.334,0,'',''),(76,'INF',8,141,0.227,21,3,39,0,32,40,0.339,19,22,3,0.312,12,0,'Jr.','Michael  Netzel','michaelnetzel',0.651,0,'Guy that gets the offense going. Toes on the chalk. Big leg kick. Hands inside and goes middle/backside.',''),(77,'SS',8,139,0.245,15,1,39,1,34,28,0.327,18,21,14,0.367,14,0,'Sr.','Reid  Gibbs','reidgibbs',0.694,0,'Showed bunt, toes on the chalk. Early contact and aggressive swings. Big swings with 2 strikes. Stayed middle and backside. Runner on bases.',''),(78,'C',8,128,0.297,12,1,38,2,38,35,0.374,23,21,6,0.461,15,0,'Sr.','Bryan  Smith','bryansmith',0.835,0,'First pitch swings. Hands close to body. Stocky body and worked backside. We can beat him in.',''),(79,'OF/1B',8,126,0.278,16,1,33,1,35,27,0.363,14,21,2,0.397,10,1,'Sr.','Jack  Brancheau','jackbrancheau',0.760,1,'First pitch swinging. Tall lanky hitter that likes to get his hands extended. Big leg kick. Likes to go gap to gap/middle. They beat him in with fastballs in and sliders away. Eye level changes with load.','JQODUSoN6o4'),(80,'OF',8,123,0.301,10,3,33,9,37,36,0.379,33,26,3,0.545,3,0,'Sr.','Eamon  McNeil','eamonmcneil',0.924,0,'Strong with little arm bar. He stays off the plate. Whittier threw him all offspeed the second game. Early contact; offspeed.',''),(81,'OF',8,122,0.295,14,0,35,0,36,26,0.377,15,25,3,0.402,11,1,'So.','Jake  Fredrickson','jakefredrickson',0.779,1,'Big load and sometimes late. Open stance to come closed to pull the ball. Flat bat path. The most pitches he saw in one at bat was 3. A lot of early swings.','Ze6I9GI49Sc'),(82,'OF',8,90,0.356,15,1,34,0,32,14,0.445,20,13,2,0.411,5,0,'Sr.','Joey  Garza','joeygarza',0.856,1,'Big lefty, pulled a double up in zone. Strong. Worked him away next at bat and F6; can bust in.','hfNUuqdo2wk'),(83,'INF',8,89,0.236,6,2,34,0,21,23,0.310,5,12,9,0.236,0,0,'So.','JP  Flores','jpflores',0.546,1,'Bunts. Not a big threat at the plate but battles. Just not strong. Aggressive base runner.','jcbkEbShC_0'),(84,'C',8,67,0.119,8,1,28,0,8,24,0.224,11,6,1,0.164,3,0,'Sr.','Jared  Baur','jaredbaur',0.388,1,'Big leg kick. Rolled over just about every at bat. Beat in and sliders away.','u7IP9HhSiPY'),(85,'UTL',8,54,0.315,5,2,17,0,17,9,0.403,7,11,1,0.426,6,0,'So.','Antonio  Andrade','antonioandrade',0.829,1,'None available.','FQB_BqKDOG8'),(86,'P',8,48,0.188,7,2,29,0,9,14,0.333,7,3,3,0.208,0,0,'Sr.','Dean  Abramson','deanabramson',0.541,0,'',''),(87,'UTL',8,40,0.300,4,0,21,0,12,9,0.378,3,5,0,0.350,2,0,'So.','Angelo  Zorn','angelozorn',0.728,0,'Early contact. Stayed through the middle with some pop.',''),(88,'1B',8,27,0.259,3,0,19,0,7,7,0.355,2,4,0,0.296,1,0,'So.','Josh  Rego','joshrego',0.651,0,'',''),(89,'P/1B',8,25,0.200,4,0,14,0,5,11,0.333,3,5,0,0.320,3,0,'So.','Max  Sterner','maxsterner',0.653,0,'',''),(91,'OF',1,167,0.311,15,2,40,4,52,17,0.368,1,26,3,0.461,9,2,'Jr.','Henri Levenson','henrilevenson',0.829,0,'Looks to pull, didn\'t get much walked a couple times. Wants to run. Will be pesky on the bases. Gives good 90s and need to get rid of the ball.',''),(92,'INF',1,146,0.247,16,0,39,7,36,24,0.349,28,29,3,0.466,9,1,'So.','Patrick Gavin','patrickgavin',0.815,1,'Swings off front foot, ambush FB. Did not look good on any breaking ball he took or swung at.','gSCSEI9j3nM'),(93,'INF',1,146,0.281,16,0,39,0,41,24,0.375,21,29,8,0.363,8,2,'Sr.','Ryan Motter','ryanmotter',0.738,0,'Patient walked alot, physical kid. Drifting a little on FB away. Looking all FB, can get inside. looked to run.',''),(94,'OF',1,136,0.346,18,1,39,4,47,18,0.462,30,27,0,0.529,9,2,'Sr.','CJ Novogradac','cjnovogradac',0.991,1,'On the plate, kinda of a free swinger like cade, hunting FB and wants to swing, didn\'t get much he had a couple easy walks.','4g4VwGoyHAs'),(95,'OF',1,124,0.274,12,1,34,0,34,20,0.353,14,24,6,0.315,5,0,'Jr.','Kevin Nakahara','kevinnakahara',0.668,1,'Slap oppo lefty. Small kid, bat speed isn\'t there. Looked to go opposite field on FB and run. Patient hitter, just attack not gonna beat us over our heads. Looked to run early in the at bat on the bases he wanted to run.','nrm5VSudZ1A'),(96,'C',1,87,0.126,9,1,33,1,11,24,0.224,4,9,0,0.184,2,0,'Sr.','Pat Shore','patshore',0.408,1,'Trying to yank everything stay away. Spins off hard, breakers and FB away maybe even extended. Wasn\'t adjusting with 2 strikes.','PSRpuPnGy6A'),(97,'INF',1,78,0.295,17,0,34,3,23,27,0.444,15,18,2,0.513,6,1,'So.','Brandon Mitchell','brandonmitchell',0.957,0,'Out and around long swing. Could not pick up the breaking ball, struck out twice on breaking balls away. Hunting FB pullside. Can still get inside too because he pulls off so hard.',''),(98,'C',1,72,0.306,8,0,25,1,22,17,0.378,13,12,4,0.375,2,0,'So.','Carson Bridges','carsonbridges',0.753,0,'',''),(99,'OF',1,32,0.188,1,0,17,0,6,11,0.278,2,5,1,0.188,0,0,'So.','Sean Emery','seanemery',0.466,0,'Has no approach at the plate. Free swinger and wants to pull it bad. Yank swings with long levers. Attack away early and in Late.',''),(100,'OF',1,25,0.240,4,0,12,0,6,4,0.355,1,5,0,0.240,0,0,'Sr.','Deji Andrew','dejiandrew',0.595,0,'',''),(101,'INF',1,19,0.211,2,0,8,0,4,3,0.286,2,3,0,0.211,0,0,'Jr.','Zach Clarke','zachclarke',0.497,1,'None available.','BvSpGD07hyA'),(102,'UTL',1,15,0.267,2,0,17,0,4,1,0.353,3,1,0,0.333,1,0,'Sr.','Nick DeGallier','nickdegallier',0.686,0,'Don\'t speed up.  Inside-Out swing w/ Slider bat speed.  LF play in to take away bloops.  RHP: Will chase FB\'s out and up.  Keep SL\'s low.  LHP: will go w/ SL\'s across zone.  Chase FB\'s out and up.',''),(103,'INF',1,10,0.100,1,0,7,0,1,3,0.182,1,1,0,0.100,0,0,'Sr.','Jack Savard','jacksavard',0.282,0,'',''),(104,'INF',1,6,0.000,1,0,5,0,0,2,0.125,1,1,0,0.000,0,0,'Sr.','Spencer Abraham','spencerabraham',0.125,0,'',''),(105,'INF',1,5,0.400,0,0,9,0,2,2,0.400,0,2,1,0.400,0,0,'So.','Andrew Kim','andrewkim',0.800,0,'',''),(106,'INF',5,129,0.287,5,2,37,2,37,37,0.348,13,12,6,0.442,7,3,'So.','Mitchell Watson','mitchellwatson',0.790,0,'',''),(107,'INF',5,130,0.285,12,1,37,0,37,10,0.354,12,15,7,0.346,6,1,'Jr.','Cortland Perry','cortlandperry',0.700,0,'Not a power threat (OF\'s in to take away bloop).  Beats most everything into ground.  Handsy swinger.  Anything w/ movement confuses him.  Will chase CB\'s & CH\'s and roll them right to 3B or SS. Weak and can not hit the ball very far. Listed as a PO but plays a decent 2B.',''),(108,'2B',5,113,0.248,8,0,35,1,28,27,0.320,14,14,1,0.345,6,1,'Sr.','Connor Moffatt','connormoffatt',0.665,0,'Pull side all day.  Will swing at anything w/ two strikes.  Also swing first-pitch in RBI situation.  Steep bat path = big hole inner half plus little length covering plate.  Two INF pop outs on outer-half FB and get-over CB. Leans over plate and will wave at breaking ball away in a pitcher\'s count.  DEFENSE: Make him move at 3B and throw on run or re-set feet.',''),(109,'OF',5,44,0.227,5,0,21,0,10,8,0.333,1,3,0,0.250,1,0,'So.','Ari Rosner','arirosner',0.583,0,'',''),(110,'OF',5,81,0.210,4,4,27,0,17,18,0.304,1,5,1,0.222,1,0,'Jr.','Alex Corado','alexcorado',0.526,0,'Middle-in is a hole in the swing.  Not strong enough to muscle flares into the OF yet.  Will chase CB\'s out of zone and CH\'s in FB counts.  Runs well.',''),(111,'OF',5,118,0.169,10,1,37,0,20,45,0.250,12,8,15,0.229,5,1,'Sr.','Mark Burleson','markburleson',0.479,0,'Big step/leg kick guy that drags the bat through the zone.  Dives hard at ball. Wants to elevate teh ball.Pull-side heavy.  Don\'t speed his bat up and let him throw a ball to the RF gap or yank a ball down the LF line.  Will chase up the ladder and with two strikes for easy 4-3\'s.',''),(112,'3B',5,52,0.154,5,0,21,0,8,23,0.224,2,1,0,0.173,1,0,'Jr.','David Adams','davidadams',0.397,0,'Fastballs away, he\'ll chase.  Changeups for easy knockouts.  Don\'t get cute.  Should be quick AB\'s.  Leave Fastball sitting middle; it\'ll be hit hard.  Don\'t speed the barrel up and let a CB/SL hang in the zone.',''),(113,'OF',5,3